"""
Write a function to find the longest common prefix string amongst an array of strings.

If there is no common prefix, return an empty string ""

Input: ["flower","flow","flight"]
Output: "fl"

Input: ["dog","racecar","car"]
Output: ""
Explanation: There is no common prefix among the input strings.

如果两个单词的第一个字母不相同，则return
如果相同，继续比

把每个单词的第一个字母放入，并统计，


"""

class Solution(object):
    def longestCommonPrefix(self, strs):
        """
        :type strs: List[str]
        :rtype: str
        """
        prefix = "aaa"*10000000

        shortest = 100000; 
        shortword = ""
        if not strs or strs[0] == '':
            return ""
        if len(strs) == 1:
            return strs[0]
        for item in strs:
            if len(item) < shortest:
                shortest = len(item)
                shortword = item
        # print("shortest word is :",shortword,' ',shortest)  
        strs.remove(shortword)  
        for index in range(len(strs)): # 遍历 flower  flow等
            item = strs[index]
            # print("It is :", item)
            tmp = ""
            for i in range(shortest): # f
                # print("     ",item[i],' VS ',shortword[i])
                if item[i] != shortword[i]:
                    break
                tmp = shortword[0:i+1]

            if len(tmp) < len(prefix):
                prefix = tmp   
            # print('prefix = ',prefix)
        return prefix

